import axios from "axios";
import { set } from "mongoose";
import { useEffect, useState } from "react";

const KitchenService = () => {
  const [greeting, setGreeting] = useState("Click for Checking Orders");
  const fetchData = async () => {
    const response = await axios.get("http://localhost:8081/fetchFromDataBase");
    console.log(response.data[0]);
    const serverData = response.data;
    const serverData1 = Object.values(serverData);
    serverData1.map((item) => {
      return (
        <>
          <h1>{item.name}</h1>
          <h1>{item.quantity}</h1>
        </>
      );
    });
    // setGreeting(serverData);
    setGreeting(JSON.stringify(serverData));
  };
  return (
    <div>
      <h2>{greeting}</h2>
      <button onClick={fetchData}>ViewOrders</button>
    </div>
  );
};

export default KitchenService;
